        ],
    dialogsData:[
        {id: 1, name: "Dima"},
        {id: 2, name: "Ilyas"},
        {id: 3, name: "Vanya"},
        {id: 4, name: "Sasha"},
        {id: 5, name: "Maximilian"}
    ],
    messagesData:[
        {id: 1, messages: "Hi"},
        {id: 2, messages: "How are you?"},
        {id: 3, messages: "What is your name?"},
    ],
}

export default state;
